import React from "react";

const PostCard = ({ post }) => {
  return (
    <div class="row">
      <div class="col-sm-6">
        <div class="card">
          <div class="card-body">
            <h5 class="card-title">{post.title}</h5>
            <p class="card-text">{post.text}</p>
            <a href="#" class="btn btn-primary">
              Перейти к посту
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PostCard;
